import React, { useContext } from "react";
import { Appcontext } from "./Navi";
import Navbar from "./Navbar";
import 'bootstrap/dist/css/bootstrap.css';


export function Profile() {
    const {userauth ,setuserauth} = useContext(Appcontext);
    return ( <div>
        <Navbar />
        <div classN="container">
        <div class="mb-3 row">
        <label for="displayName" class="col-sm-2 col-form-label">userName</label>
        <div class="col-sm-5">
        <input type="text" class="form-control" id="displayName" />
        </div>
        <div class="mb-3 row">
        <label for="staticEmail" class="col-sm-2 col-form-label">Email</label>
        <div class="col-sm-5">
        <input type="text" readonly class="form-control-plaintext" id="staticEmail" value={userauth.email}/>
        </div>
        </div>
       </div>
        </div>


    </div> );
}
